import React from 'react'
import styled from 'styled-components';
import CtaButton from './CtaButton';
import SmallHeading from './SmallHeading';
import blockchain from '../../image/12476380705.png';

function MainContent() {
    return (
        <MainContentStyled >
            <div className="content">
                <div className="left">
                    <SmallHeading title={'Leading with simplicity and intelligence'} identifier={'Before'} />
                    <h1>
                        Developer Student Club (IVE) <span className='GradientText'><br /></span>
                    </h1>
                    <p>
                        By Google Developers
                    </p>
                    <div className="btns-con">
                        <CtaButton name={'discover more'} />
                    </div>
                </div>
                <div className="right">
                    <img src={blockchain} alt="" />
                </div>
            </div>
        </MainContentStyled >
    )
}


const MainContentStyled = styled.div`
    position: absolute;
    top: 0;
    left: 50%;
    transform: translateX(-50%);
    width: 80%;
    height: 100vh;
    .overlay{
      width: 100%;
      height: 100%;
      margin: auto;

        .content {
          display: grid;
          grid-template-columns: repeat(2, 1fr);
          height: 100%;
          width: 100%;

          .left {
            display: flex;
            justify-content: center;
            flex-direction: column;

            h1 {
              padding: 1.8rem 0;
            }

            .btns-con {
              margin-top: 3rem;
            }
          }

          .right {
            img {
              position: absolute;
              right: -11%;
              bottom: -1%;
              width: 60%;
            }
          }
        }}
`;
export default MainContent;
